import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import GlobalProvider from "./contexts/GlobalProvider";

import "./i18n";

//Import Scss
import "./assets/scss/themes.scss";
import SquadCommunicator from "./services/SquadCommunicator";
import SquadSipCommunicator from "./services/SquadSipCommunicator";
import ModalDisconnected from "./components/ModalDisconnected";
import * as Sentry from "@sentry/react";
import { Integrations } from "@sentry/tracing";

Sentry.init({
  dsn:
    "https://3038b70a6daf4f1eb914e104efdf7795@o514689.ingest.sentry.io/5618304",
  integrations: [new Integrations.BrowserTracing()],
  tracesSampleRate: 1.0,
});

ReactDOM.render(
  <GlobalProvider>
    <SquadSipCommunicator />
    <SquadCommunicator />
    <ModalDisconnected />
    <App />
  </GlobalProvider>,
  document.getElementById("root")
);
